import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route, Link, Redirect } from "react-router-dom";
import { AuthenMain } from "./authen";
import { Button, ButtonGroup, ButtonToolbar } from 'react-bootstrap';
import { ShowOffences } from "./offences";
import { Search } from "./newsearch";




class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {

    return (
      <BrowserRouter>
        <div className="routes">
            <Link to="/offences">
              <Button variant="secondary" className="links">
                Offences
            </Button></Link>

          <ButtonGroup size="lg" aria-label="First group">
            <Link to="/authen"><Button variant="secondary" className="links">Authentication</Button></Link>
          </ButtonGroup>

          <ButtonGroup size="lg" aria-label="Second group">
            <Link to="/newsearch">
              <Button variant="secondary" className="links">
                Protected
            </Button></Link>
          </ButtonGroup>

        </div>

        <Route path="/authen" component={AuthenMain} />
        <Route path="/newsearch" component={Search} />
        <Route path="/offences" component={ShowOffences} />

      </BrowserRouter>
    )



  }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
